import {TemplateArgument} from "./TemplateArgument.js"
import {Register} from "../../genes/Register.js"

const $global = Register.$global

export const RawTemplateArgument = Register.global("$hxClasses")["mcl.args.RawTemplateArgument"] = 
class RawTemplateArgument extends Register.inherits(TemplateArgument) {
	new(s, pos) {
		super.new(s, pos);
	}
	parseValue(value, pos, ctx) {
		return {"success": true, "value": value, "raw": value};
	}
	static register() {
		TemplateArgument.register("raw", RawTemplateArgument);
	}
	static get __name__() {
		return "mcl.args.RawTemplateArgument"
	}
	static get __super__() {
		return TemplateArgument
	}
	get __class__() {
		return RawTemplateArgument
	}
}

